@diamondlancer 
I think it's how the characters are designed that remind you of Disgaea.  I see a little bit of Etna (upper right) and Flonne (lower left).  Likewise, the catgirl in th upper right reminds me of one of the characters from Shining Tears, but I can't recall her name at the moment.
It seams more like borrowed concepts than Tradedress, due to some obvious differences, so I wouldn't think too much about it.
